import Card from './Card';
import './App.css';

function Hook(props) {  
    return (
      <Card className="hook">
        for (i of props)
        {
          <HookItem
            title={props.items[i].title}
            rating={props.items[i].rating}
            date={props.items[i].date}
          />
        }
      </Card>
    );
  }
